import turtle

screen = turtle.Screen()
screen.setup(width=2000, height=2000,startx=990,starty=0)
t = turtle.Turtle()
angle = 65
lenstep = 10

def step(c):
    match c:
        case 'F' :
            t.forward(lenstep)
        case '-' :
            t.left(angle)
        case '+' :
            t.right(angle)

